import './App.css';

function App() {
  return (
    <div>
      <h1 className="App">Your Tasks</h1> 
      <div className="Columns" style="display:flex; justify-content:space-between;">
          <div>
            <h2>Task</h2>
            <h2>Priority</h2>
            <h2>Deadline</h2>
          </div>
          <div>
            <button>Create task</button>
          </div>

      </div>
    </div>
  );
}

export default App;
